import struct

def get(x):
    s = ""
    
    assert len(x) == 2048
    chunk_size = len(x) // 512
    result = [x[i:i + chunk_size] for i in range(0, len(x), chunk_size)]
    for r in result:
        bin_values = [bin(ord(x)) for x in r]
        combined_bin = ''.join(bv[2:].zfill(8) for bv in bin_values)
        combined_bin = combined_bin.zfill(32)
        s += struct.pack('!I', int(combined_bin, 2)).hex()
    return s

